import { FC } from 'react';

const Blog: FC = () => {
    return (
        <div  id="service" className="kioto_tm_section">
            <div className="container"></div>
                <div className="kioto_tm_service">
                    <div className="kioto_tm_title">
                        <span>// My Blog</span>
                    </div>    
                            <p>Check out my latest blog posts on dev.to:</p>
            <a 
                href="https://dev.to/your-username" 
                target="_blank" 
                rel="noopener noreferrer"
            >
                Visit My dev.to Blog
            </a>
                </div>
            </div>

    );
}

export default Blog;
